import React from 'react';
import { View, Text } from 'react-native';

function HomeScreen({ navigation }) {
  return (
    <View>
      <Text>Home Screen</Text>
    </View>
  );
}

HomeScreen.navigationOptions = {
  title: 'Home',
};

export default HomeScreen;
